import React, { Component } from 'react'
import './pich.css'
export class Timer2 extends Component {
    constructor()
    {
        super()
        this.state={
            time:10,
            count: 0,
            score: '',
            text:''
        }
    }
    componentDidMount()
    {
        this.interval=setInterval(this.tick,1000);
    }
    tick=()=>
    {
        if(this.state.time>0){
        this.setState({
            time:this.state.time-1
        })
    }
    }
    incrementCount=()=>{
        if(this.state.time>0)
            this.setState({
                count:this.state.count+1
            })
            else{
                    this.setState({
                        score:'score: '+this.state.count,
                        text:'Enough try again later'
                    })
            }
        }
        restart=()=>{
                this.setState({
                    score:'',
                    text:'',
                    count:0,
                    time:10
                       })

            }

  render() {
    return (
      <div>
        <h1>{this.state.time}</h1>



        <img src='data:image/jpeg;base64,' onClick={this.incrementCount}></img>
        <p>Clicked {this.state.count} times</p>
        <p>{this.state.score}</p>
        <p>{this.state.text}</p>
        <button onClick={this.restart}>restart</button>
      </div>
    )
  }
}

export default Timer2